struct Solution;

use std::collections::{BTreeSet, VecDeque};

impl Solution {
    fn add_number(arr: &mut [i32; 32], num: i32) {
        let mut num = num;
        let mut bit_position = 0;
        while num != 0 {
            arr[bit_position] += num & 0x1;
            num >>= 1;
            bit_position += 1;
        }
    }

    fn remove_number(arr: &mut [i32; 32], num: i32) {
        let mut num = num;
        let mut bit_position = 0;
        while num != 0 {
            arr[bit_position] -= num & 0x01;
            num >>= 1;
            bit_position += 1;
        }
    }

    fn get_number(arr: &[i32; 32]) -> i32 {
        let mut num = 0;
        let mut position = 31;
        loop {
            if arr[position] != 0 {
                num |= 0x1 << position;
            }
            if position == 0 {
                break;
            }
            position -= 1;
        }
        num
    }

    pub fn minimum_subarray_length(nums: Vec<i32>, k: i32) -> i32 {
        let mut nums = nums;
        let mut counted_ones = [0; 32];

        let mut min = i32::MAX;

        let (mut start, mut end) = (0, 0);

        while end < nums.len() {
            Solution::add_number(&mut counted_ones, nums[end]);
            while start <= end && Solution::get_number(&counted_ones) >= k {
                min = std::cmp::min(min, (end-start+1) as i32);
                Solution::remove_number(&mut counted_ones, nums[start]);
                start +=1;
            }
            end +=1;

        }

        match min {
            i32::MAX => -1,
            _ => min,
        }
    }
}

fn main() {
    println!("{}", Solution::minimum_subarray_length(vec![1, 2], 0));
    println!(
        "{}",
        Solution::minimum_subarray_length(vec![5, 1, 32, 86, 2], 117)
    );
}

